import React, { useEffect } from 'react'

const Register = () => {
  useEffect(()=>{
    document.title="Register Ecommerce"
  },[])
  return (
   <div className="row">
    <div className="col-lg-6 col-lg-7">
      <div className="card">
        <div className="card-header border-bottom border-primary ">
<h2 className='text-center text-primary' style={{fontSize:'40px'}}></h2>
        </div>
      </div>
    </div>
   </div>
  )
}

export default Register
